import styled from "styled-components";
import { Container, Grid, GridColumn } from "semantic-ui-react";

export const StyledList = styled.li`
  &&& {
    font-family: Avenir;
    font-style: normal;
    font-weight: normal;
    font-size: 16px;
    line-height: 22px;
    /* identical to box height */

    text-decoration-line: underline;

    /* Red */

    color: #e62b1e;
  }
`;
